import Swiper, { pluginController } from "../components/Swiper";

class Home {
  render() {
    const swiper = new Swiper(
      "slider",
      [
        "https://dm30webimages.geely.com/GeelyPromotion/ANEW2/xyL/kv/pc.2.1.jpg",
        "https://geely-portal-prod-ntt-obs-02.obs.cn-east-2.myhuaweicloud.com/GeelyPromotion/ANEW2/pinpai/lunbo/byl.png",
      ],
      6000
    );

    window.addEventListener("load", (event) => {
      swiper.preload();
      swiper.registerPlugins(pluginController);
      swiper.start();
    });

    return `
        <div id="home">
          ${swiper.render()}
        </div>

        `;
  }
}

export default Home;
